@pepejeans SUN23 style PJ5199 Bangkok has been shortlisted for Unisex Frame of the Year at this years #LoveEyewearAwards at @100optical!

BANGKOK has a light angular aviator frame with a top bar and stylish half-rims framing the lenses. This unisex metal style features a discreet Pepe Jeans logo on the temples with marbled acetate temple tips complementing the lenses.

#Mondottica #LoveEyewearAwards #100Optical

@pepejeans Kid’s Optical 23 style PJ4077 has been shortlisted for Kid’s Frame of the Year at this years #LoveEyewearAwards at @100optical!

Kranky features youthful, multi-coloured temple details are playful while the classic shape will suit faces of all genders.

#Mondottica #LoveEyewearAwards #100Optical

@scotch_soda SUN23 style SS7028 Marina has been shortlisted for Women’s Sunglass of the Year at this year’s Love Eyewear Awards at @100optical!

With a sunset graduated lens, the innovative design features a double layer front with an eye-catching frame-in-frame effect. The temples house a bespoke ripple core wire with a final pop of colour on the end tips finishing off this style. The negative space featured here, and elsewhere in the collection, is a nod to the tramlines running through the streets of Amsterdam. 

#Mondottica #LoveEyewearAwards #100Optical

@pepejeans have also launched their latest optical range for kids. The collection mirrors the shapes and colours seen throughout the latest adult collection.

